import React from 'react';
import ReactDOM from 'react-dom';
import List from './List';

const items = [
  { text: '' },
  { text: 'Item 2' },
  { text: 'Item 3' },
];

ReactDOM.render(
  <List items={items} />,
  document.getElementById('root')
);
